  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a compilation of published
  data on primary production, herbivory, and nutrient content of primary producers
  in pristine communities of microphytobenthos, macroalgae and seagrasses in estuarine
  systems.nnPurpose: To examine the variability in herbivory within and across pristine
  communities of microphytobenthos, macroalgae and seagrasses. The dataset is available
  as supplemental material for a chapter on benthic grazing in a book about estuarine
  nutrient cycling.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
